Falling Leaves/Giorgobistve/La chute des feuilles(1966)

1966, Soviet Union, 91 min

Directed by: Otar Iosseliani

Written by: Amiran Chichinadze

Cast: Ramaz Giorgobiani, Gogi Kharabadze, Marina Kartsivadze


SYNOPSIS:

When A Young Engineer Takes A Job In A Wine Factory, He Is Warned Not To Become Too Closely Involved With The Other Workers. He Converses With A Flirtatious Young Woman And Gets Beaten Up By A Thug Who Admires Her. The Young Man Warns His Boss That A New Vat Of Wine Is Not Acceptable To Be Bottled. Under Pressure To Meet The Product Quota, The Boss Has It Bottled Anyway. The Engineer Fails To Convince The Bureaucracy That The Swill Is Unfit For Human Consumption. An Ironic Twist Finds The Engineer And Some Workers Being Served The Wine In A Local Tavern. This Film Marks The Directorial Debut For Georgian Director Otar Iosseliani. The Literal Russian Title Of The Feature Is Listopad.
